            height: 15%;

            height: 80%;

            flex-direction: row;
            width: 100%;
            height: 70%;

        }

            width: 50%;
            height: 90%;

            flex-wrap: wrap;
            width: 40%;
            height: 80%;

            justify-content: space-evenly;

        .two-container-three {
            width: 20%;
            height: 10%;
            border: 5px solid black;
        }

        .three-container {

            display: flex;
            justify-content: center;
            width: 100%;
            height: 15%;
            background-color: #ECCEAE;

        }
